import React from 'react'


export default class Starwars extends React.Component {
    constructor(){
        super()
        this.state={
          person : []
        }
      }
      componentDidMount() {
        fetch('https://svcs.ebay.com/services/search/FindingService/v1?SECURITY-APPNAME=KarimZit-TestKey-PRD-83882c164-20d40dd0&OPERATION-NAME=findItemsByKeywords&SERVICE-VERSION=1.0.0&RESPONSE-DATA-FORMAT=JSON&callback=_cb_findItemsByKeywords&REST-PAYLOAD&keywords=books&paginationInput.entriesPerPage=6&GLOBAL-ID=EBAY-US&siteid=0')
          .then(response => {return response.json()})
          .then(data => this.setState({person: data})
        )       
        console.log(this.state.person)

    } 
    render(){
        return (
        <div>
            <h1>
            {this.state.person}
            </h1>
        </div>)
    }
}
